import './App.css';
import { BrowserRouter as router, Routes, Route } from "react-router-dom";
import home from './pages/home';
import projects from './pages/projects';
import experiences from './pages/experiences';

function App() {
    return ( <
        div className = "App" >
        <
        router >
        <
        Routes >
        <
        Route path = '/'
        element = { < home / > }
        /> <
        Route path = '/projects'
        element = { < projects / > }
        /> <
        Route path = '/experiences'
        element = { < experiences / > }
        /> <
        /Routes> <
        /router>

        <
        /div>
    );
}

export default App;
